import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import SignupForm from './Signup';

function App() {
    return (
        <div>
            <h1>Hello, React!</h1>
            <BrowserRouter>
    <Routes>
      {/* <Route path="/" element={<Home />} /> */}
      <Route path="/SignupForm" element={<SignupForm />} />
    </Routes>
  </BrowserRouter>

        </div>
    );
}

export default App;
